// export default Sidebar;
import React from 'react';
import './Sidebar.css'; // CSS file for sidebar styling
import logo from '../assets/logo.jpg';

const Sidebar = ({ onMenuClick }) => {
  return (
    <div className="sidebar">
      <img src={logo} alt="Logo" className="logo" />
      <ul>
        <li onClick={() => onMenuClick('Consultants')}>Consultants</li>
        <li onClick={() => onMenuClick('Active Users')}>Active Users</li>
        <li onClick={() => onMenuClick('Inactive Users')}>Inactive Users</li>
        {/* <li onClick={() => onMenuClick('Edit Profiles')}>Edit Profiles</li> */}
        {/* <li onClick={() => onMenuClick('Logout')}>Logout</li> */}
      </ul>
    </div>
  );
};

export default Sidebar;
